import { Card } from 'react-bootstrap';
import MyStyle from '../styles/colorStyle';

const Footer = () => (
    <dev style={MyStyle.col_background}>
        <Card >
            <Card.Body>
                <Card.Text className="text-center" style={{ color: 'white' }}>
                    Copyright@ 2020
                <span> Muhalik </span>
                    - Online Shopping Website
            </Card.Text>
            </Card.Body>
        </Card>
        <style jsx>{`
            dev {
                position: absolute;
                left: 0;
                bottom: 0; 
                right: 0;
            }
            span {
                font-size: medium;
                font-weight: bold
            }
        `}</style>
    </dev>
)

export default Footer;
